import { Button, Stack } from '@mui/material';

const options = [
  {
    title: 'Employee Infomation',
  },
  {
    title: 'Contract Information',
  },
  {
    title: 'Employment Details',
  },
  {
    title: 'Salary & Wages',
  },
  {
    title: 'Others',
  },
];

function Option() {
  return (
    <Stack spacing={2} direction="row">
      {options.map((text) => (
        <Button>{text.title}</Button>
      ))}
    </Stack>
  );
}

export default Option;
